sys_variable_value.value:
(function execute(inputs, outputs) {
	try {
		var action_inputs = {};
		var dynamic_sheets_data = [];
		var aliasSysId = "";
		try {
			if (typeof (inputs.alias) == "object") {
				aliasSysId = inputs.alias.sys_id;
			} else {
				var alias = JSON.parse(inputs.alias);
				aliasSysId = alias.value;
			}
		} catch (e) {
			aliasSysId = inputs.alias;
		}
		var gr = new GlideRecord('sys_alias');
		gr.addQuery('sys_id', aliasSysId);
		gr.query();

		if (gr.next())
			action_inputs['connection_credential_alias'] = gr; // GlideRecord of table: sys_alias 
		else
			throw "Invalid Connection & Credential Alias";

		action_inputs['spreadsheet_id'] = inputs.spreadsheet; // String 

		// Execute Synchronously: Run in foreground. Code snippet has access to outputs.
		var action_outputs = sn_fd.FlowAPI.executeAction('global.get_spreadsheet_details', action_inputs);


		// Get Outputs:
		// Note: outputs can only be retrieved when executing synchronously.
		var sheets = action_outputs['variable2']; // Array.Object
		var status = action_outputs['variable4']; // Choice
		var error_message = action_outputs['variable5']; // Choice

		if (status == "Success") {
			outputs.status = "Success";
			for (var i = 0; i < sheets.length; i++) {
				var sheet_obj = {
					name: sheets[i]['sheetId'],
					label: sheets[i]['title']
				};
				dynamic_sheets_data.push(sheet_obj);
			}
			outputs.sheets = {
				data: dynamic_sheets_data
			};
		} else {
			outputs.status = "Error";
			outputs.error_message = error_message;
		}

	} catch (ex) {
		gs.error(ex);
		outputs.status = "Error";
		outputs.error_message = ex;
	}
})(inputs, outputs);

